import React from 'react';
import { Switch ,Route } from 'react-router-dom'

function App() {
  return (
    <div>
      <Switch>
        <Route path='/login' component={()=><div>登录界面</div>}></Route>
        <Route path='/upload'>上传界面</Route>
      </Switch>
    </div>
  );
}

export default App;
